import { Panel, FlexboxGrid, Checkbox, InputPicker } from 'rsuite';

const data = [
  {
    label: 'Eugenia',
    value: 'Eugenia',
    role: 'Master',
  },
  {
    label: 'Kariane',
    value: 'Kariane',
    role: 'Master',
  },
  {
    label: 'Louisa',
    value: 'Louisa',
    role: 'Master',
  },
];

function ItemCard() {
  return (
    <FlexboxGrid justify='space-around' style={{ margin: 10 }}>
      <FlexboxGrid.Item colspan={3}>
        <img
          src='https://i.pinimg.com/474x/e6/3d/69/e63d6960e27825cc4a32d5b984de2994.jpg'
          height='140'
          alt='juup'
        />
      </FlexboxGrid.Item>
      <FlexboxGrid.Item colspan={6}>
        <Panel header='Item Name' style={{ height: 140 }}>
          <p>
            <small>Size: </small>
          </p>
          <p>
            <small>Size: </small>
          </p>
        </Panel>
      </FlexboxGrid.Item>
      <FlexboxGrid.Item colspan={2}>
        <Checkbox> Return</Checkbox>
      </FlexboxGrid.Item>
      <FlexboxGrid.Item colspan={6}>
        <InputPicker data={data} placeholder='Select Reason' size='lg' />
      </FlexboxGrid.Item>
    </FlexboxGrid>
  );
}

export default ItemCard;
